import React from "react";
import HomestayCard from "../../shared/HomestayCard";
import tourData from "../../assets/data/tours";
import { Col } from "reactstrap";

const HomestayUnggulan = () => {
  const {
    data: Featuredhomestays,
    loading,
    error,
  } = useFetch(`${BASE_URL}/tourguide/search/getFeaturedtourguide`);
  console.log(Featuredtourguides);
  return (
    <>
    {loading && <h4>Loading.......</h4>}
      {error && <h4>{error}</h4>}
      {!loading &&
        !error &&
      tourData?.map((tour) => (
        <Col lg="4" className="mb-4" key={tour.id}>
          <HomestayCard tour={tour} />
        </Col>
      ))}
    </>
  );
};

export default HomestayUnggulan;
